import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
// USERS is an array of objects, which we need to convert into JSX (javascript components)
import { users } from "../data";


const employeeTable = users.map((users) =>
    <table>
        <tr>
            <td>{users.id}</td>
        </tr>
        <tr>
            <td>{users.name}</td>
        </tr>
        <tr>
            <td>{users.department}</td>
        </tr>
        <tr>
            <td>{users.role}</td>
        </tr>
        <tr>
            <td>{users.email}</td>
        </tr>
    </table>);

function Headline() {

    return (
        <div>
            {employeeTable}
        </div>
    );
}

